function gen_mlb_today() {

  //const myElement = document.getElementById("demo");

  //var var01 = document.getElementById('input_id').value;

  var var01 = document.getElementById('logemail').value;
  

  var old_teams = [];  

  for(let i = 0; i < old_mlb_data.length; i++) {
    let obj = old_mlb_data[i];

    //console.log(obj.strDate);
    //console.log(var01);
    if (var01 == obj.strDate) {
      old_teams.push(obj);
    }
  }

  var new_teams = [];  

  for(let j = 0; j < new_mlb_data.length; j++) {
    let obj = new_mlb_data[j];

    //console.log(obj.strDate);
    //console.log(var01);
    if (var01 == obj.strDate) {
      new_teams.push(obj);
    }
  }

  mix_teams = [];

  for(let oTeam = 0; oTeam < old_teams.length; oTeam++) {
    //console.log(old_teams[oTeam].vis);
    for(let nTeam = 0; nTeam < new_teams.length; nTeam++) {
      
      if (old_teams[oTeam].vis == new_teams[nTeam].vis ) {
        mix_teams.push(old_teams[oTeam].vis);
      }

      if (old_teams[oTeam].vis == new_teams[nTeam].hom ) {
        mix_teams.push(old_teams[oTeam].vis);
      }


      if (old_teams[oTeam].hom == new_teams[nTeam].vis ) {
        mix_teams.push(old_teams[oTeam].hom);
      }

      if (old_teams[oTeam].hom == new_teams[nTeam].hom ) {
        mix_teams.push(old_teams[oTeam].hom);
      }

    } 
    
    //console.log(mix_teams.sort());

  }

  
  //document.getElementById('old_mlb_teams').innerHTML = new_teams;


  const template2 = document.querySelector('#template2');
  const clone2 = template2.content.cloneNode(true);
  const listElement2 = clone2.querySelector('.template2-list');


  const lists2 = document.querySelector('.lists2');

  mix_teams.sort().forEach(i => {
    let newClone2 = listElement2.cloneNode(true)
    newClone2.querySelector('.template2-team').textContent = i;
    lists2.append(newClone2);
  })

}

